description:
Category	Rock, Comedies, Adventure, Slapstick, Rivalry, On-The-Road, All-Star
Starring	Burt Reynolds, Dean Martin, Dom DeLuise, Shirley MacLaine, Sammy Davis, Jr., Telly Savalas, Catherine Bach, Charles Nelson Reilly, Susan Anton
Director	Hal Needham
This 108 minute feature film DVD involves a hilarious come dy of a cross country auto race starring Burt Reynolds, Dom DeLuise, Shirley MacLaine, and a Rat Pack reunion - Frank Sinatra, Dean Martin, and Sammy Davis Jr.
More than two dozen popular stars get involved in a comic cross-country car chase in this sequel to THE CANNONBALL RUN.
